import React, { Component } from 'react';
import { withCookies } from 'react-cookie';
import './SupplierDetails.style.scss';
import { CloseCircleFilled } from '@ant-design/icons';

class SupplierDetails extends Component {
  render() {
    return (
      <div className="product-management__supplier-dialog__supplier-details">
        <div className="product-management__supplier-dialog__supplier-details__panel animated slideInRight">
          <div className="product-management__supplier-dialog__supplier-details__panel__header">
            <CloseCircleFilled className="product-management__supplier-dialog__supplier-details__panel__header__btn-close" />
          </div>
        </div>
      </div>
    )
  }
}
export default withCookies(SupplierDetails);
